import React from "react";
import "./App.css";
import {render} from "react"
import { Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Books from "./components/Books";
import Users from "./components/Users";

const App = () => {
	return (
		<>
			<Navbar />

			<Route path="/books">
				<Books />
			</Route>
			<Route path="/users">
				<Users />
			</Route>
		</>
	);
};

export default App;
